import React from 'react';
import { Link } from "react-router-dom";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Home from "./header/home";
import Search from "./header/search";


/*function gotoSearch(){
  return <Redirect to= {"/search"}/>;
  alert("Hello");
}*/
function App() {
  return (
      <>

          <Router>
              <Routes>

                  <Route
                      exact
                      path="/"
                      element={<Home />}
                  />


                  <Route
                      path="/search"
                      element={<Search />}
                  />
              </Routes>
          </Router>
      </>
  );
}







export default App;
